import './ReviewFetcher.css';

import React, { useState, useEffect } from 'react';

const GoogleReviews = () => {
  const [reviews, setReviews] = useState([]);
  const [isLoaded, setIsLoaded] = useState(false)

  useEffect(() => {
    const backendUrl = 'http://localhost:8000/google-reviews';

    fetch(backendUrl)
      .then((response) => {
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        return response.json();
      })
      .then()
      .then((data) => {
        console.log('Fetched data:', data); // Log the response data
        setReviews(data);
      })
      .catch((error) => {
        console.error('Error fetching reviews:', error); // Log any errors
      });
  }, []);

  console.log('%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%',reviews[0].text)

  if(isLoaded) {
    return (
      <div>
        <h2>Google Reviews</h2>
        <ul>
          {reviews.map((review, index) => (
            <li key={index}>
              <strong>{review.author_name}:</strong> {review.text}
            </li>
          ))}
        </ul>
      </div>
    );
  };
  }

export default GoogleReviews;
